import { useMediaQuery } from "@mui/material";
import Image from "next/image";
import * as React from "react";
import { SVGProps } from "react";
import { useTheme } from "styled-components";

type Props = SVGProps<SVGSVGElement> & {
  variant?: "light" | "dark";
};

const White = (props: SVGProps<SVGSVGElement>) => (
  <svg
    width={117}
    height={39}
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    {...props}
  >
    <path fill="url(#a)" d="M0 0h116.158v38.059H0z" />
    <defs>
      <pattern
        id="a"
        patternContentUnits="objectBoundingBox"
        width={1}
        height={1}
      >
        <use xlinkHref="#b" transform="matrix(.0004 0 0 .00124 0 0)" />
      </pattern>
      <image
        id="b"
        width={2456}
        height={804}
        xlinkHref="data:image/png;base64,"
      />
    </defs>
  </svg>
);

const Dark = () => {
  const { devices } = useTheme();
  const isLaptop = useMediaQuery(`${devices.laptop}`);

  if (isLaptop) {
    return (
      <Image
        src={"/logo.png"}
        height={66}
        width={177}
        alt="Logo Villa pinedo"
      />
    );
  }

  return (
    <Image
      src={"/logo-small.png"}
      width={45}
      height={44.88}
      alt="Logo Villa pinedo"
    />
  );
};

export default function Logo({ variant = "dark" }: Props) {
  switch (variant) {
    case "light":
      return <White />;

    default:
      return <Dark />;
  }
}
